import classes from "./Modal.module.css";

const modal = (props: any) => {
  return (
    <>
      <div className={classes.Background} onClick={props.onCloseModal}></div>
      <div className={classes.Modal}>
        <button onClick={props.onCloseModal} className={classes.CloseButton}>
          X
        </button>
      </div>
    </>
  );
};

export default modal;
